    />

      window.routerBase = "/cent-react-wheels";
    </script>
    <script>
      //! umi version: 3.4.7
    </script>
    <script>
      !(function () {
        var e = localStorage.getItem("dumi:prefers-color"),
          t = window.matchMedia("(prefers-color-scheme: dark)").matches,
          r = ["light", "dark", "auto"];
        document.documentElement.setAttribute(
          "data-prefers-color",
          e === r[2] ? (t ? r[1] : r[0]) : r.includes(e) ? e : r[0]
        );
      })();
    </script>
    <title>Slider</title>
  </head>

    <div id="root"></div>

    <script src="/cent-react-wheels/umi.js"></script>
